import React from "react";
import { ImageBackground } from "react-native";
import { styles } from "../../styles/styles";

const image = {
    uri:
      "https://i.pinimg.com/236x/44/bc/55/44bc55c1d5154d81bacc6f87a73a779e.jpg",
  };

const AppBackgroundForModal = (props) => <ImageBackground style={styles.appCard} source={image} style={styles.image}>{props.children}</ImageBackground>;

export default AppBackgroundForModal;
